import React from 'react'

class NavBar extends React.Component{
  render(){
    return(
      <div className="navbar">
        <a href="#">Home</a>
        <a href="#">About</a>
        <a href="#">FAQ</a>
        <a href="#">Contact</a>
      </div>
    )
  }
}

export default NavBar
